import React from 'react';
import Navbar from '../components/UI/Navbar';
import Main from '../components/UI/Main';
import Footer from '../components/UI/Footer';
import '../styles/All.css';

const DashBoard = () => {
  return (
    <div>
        <Navbar />
        <Main />
        <Footer />
    </div>
  );
};

export default DashBoard;
